import React from 'react'
import profPic1 from '../../background_images/profile_pic.png'
import profPic2 from '../../background_images/profile_pic.png'
import profPic3 from '../../background_images/profile_pic.png'
import profPic4 from '../../background_images/profile_pic.png'
import profPic5 from '../../background_images/profile_pic.png'
import profPic6 from '../../background_images/profile_pic.png'
import profLink from '../../background_images/profile_linkd.png'
import './component2.css'
const getProfile_pic=(each_profile)=>{
    if(each_profile.id==1)
    {
        return profPic1
    }
    if(each_profile.id==1)
    {
        return profPic2
    }
    if(each_profile.id==1)
    {
        return profPic3
    }
    if(each_profile.id==1)
    {
        return profPic4
    }
    if(each_profile.id==1)
    {
        return profPic5
    }
    if(each_profile.id==1)
    {
        return profPic6
    }
    return profPic1
}
const Component2=({each_profile})=>{
    return(
        <div className="block">
            <img className="profile_pic" src={(each_profile)=>getProfile_pic(each_profile)} alt="Img"/>
            <p className="profile_name">{each_profile.name}</p>
            <a  className="profile_link" href={each_profile.link} target="blank"><img className="profile_link_img" src={profLink} alt="Img"/></a>
            <p className="profile_post">{each_profile.post}</p>
        </div>
    )
}
export default Component2;
